import "./Signup.css";
const Signup = () => {
  return (
    <>
      <div className="signup">
      <span className="signup-title">Signup</span>
        <form className="signup-form">
        <label>Username</label>
        <input className="signup-input" type="text" placeholder="Enter your username..." />
        <label>Email</label>
        <input className="signup-input" type="email" placeholder="Enter your email..." />
        <label>Password</label>
        <input className="signup-input" type="password" placeholder="Enter your password..." />
        <div className="btn"><button className="signup-btn">Signup</button>
        <button className="login-btn">Login</button></div>
        </form>

      </div>
    </>
  );
};
export default Signup;
